import './About.css';

const About = () => {
    return (
        <div className="container">
            <section id="about">
                <div className="title-wrapper">
                    <h3>Robert Sheffield? Never heard of him</h3>
                </div>
                <div className="content-wrapper">
                    <img src="./assets/robert_ron.jpg" alt="boy and cat" />
                </div>
            </section>
        </div>
    )
}

export default About;
